using System;
using System.Collections.Generic;
using System.Runtime.CompilerServices;

class Program
{
    static bool TestRvaField(ReadOnlySpan<byte> value)
    {
        bool match = true;
        for (byte i = 0; i < value.Length; i++)
        {
            if (value[i] != (byte)(9 - i))
            {
                match = false;
                Console.WriteLine(
                    "Mismatch at offset {0}: value[{0}] = {1}, should be {2}",
                    i,
                    value[i],
                    9 - i);
            }
        }
        return match;
    }

    static int Main()
    {
        var fieldClass = new LotsOfFields();
        
        if (!TestRvaField(fieldClass.Field100))
        {
            Console.WriteLine($"Failed on {nameof(fieldClass.Field100)}");
            return 102;
        }

        if (!TestRvaField(fieldClass.Field65540))
        {
            Console.WriteLine($"Failed on {nameof(fieldClass.Field65540)}");
            return 102;
        }

        Console.WriteLine("PASS");
        return 100;
    }
}

